                <label>SALARY</label>
                <br/><br/>

                <input type="number" Value={sal} onChange={getSal} required/>

                <br/><br/>
                <label>COMPANY</label>
                <br/><br/>

                <input type="name" Value={comp} onChange={getComp} required/>
                
                <br/><br/>
                <button type="submit">Submit</button>

            </form>
           </div>
        </div>
    )
}
export default Create_user
